7-21T19:10:16.246747","status":"completed"},"tags":[]},"source":["Riders from both groups follow the same trends in riding start times. Over half of the rides in both groups started in the afternoon.\n","\n","# Conclusions\n","\n","The current goal in the company in too encourage casual riders to transition into Cyclistic Members. Tourists are not likely to become members, as they will not get enough use out of the membership. Locals need to feel it is more cost effective to be a member rather than paying per ride or per day.\n","\n","## Recommendations\n","\n","I recommend implementing a pricing structure that has prices that vary based on the day of the week and time of day. The cost for members would be uneffected, and proper implementation will make membership more desirable to repeat casual riders.\n","\n","1. Weekends are popular ride times for casual riders, therefore I recommend making single ride or day passes more expensive on Fridays, Saturdays, and Sundays.\n","\n","2. The afternoon is the most popular time to start a ride, therefore I recommend increasing the price for single rides if they start in the afternoon.\n","\n","3. Casual riders are more likely to take longer rides, therefore I recommend making single rides more expensive if they last greater than an hour.\n","\n","\n","I recognize that recommendation #3 may already be addressed by the existence of day passes, so I have an additional recommendation if necessary.\n","\n","4. Electric bikes are more commonly selected by casual riders, therefore I recommend having a number of electric bikes reserved for members. This may encourage casual riders to become members in order to gain access to electric bikes.\n","\n","### Thank You\n","\n","Thank you for taking the time to read my report. Thank you to the Google Data Analytics course for providing me with the tools to accomplish this"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","fi